/*This UDF split content text after 132 character as  
segment E101BAPISDTEXT , TEXT_LINE has max length 132
*/
int totalBapiSDTextCreate = 0;
int count = 0;
for (int i = 0; i < contentText.length; i++) {
     totalBapiSDTextCreate = 0;
     count = 0;
     if (contentText[i].length() <= 132) {
            result.addValue(contentText[i]);
     }
     else {

        int noLines = contentText[i].length() / 132;
        int reminder = contentText[i].length() % 132;

        if ( reminder == 0 ) {
               totalBapiSDTextCreate = noLines;
        } 
        else {
                totalBapiSDTextCreate = noLines + 1;
        }

        for (int j = 0; j < totalBapiSDTextCreate; j++) {
            if (count < (contentText[i].length() - 132)) {
                result.addValue(contentText[i].substring(count, count + 132));
                count = count + 132;
            } else
                result.addValue(contentText[i].substring(count, contentText[i].length()));
        }
     }
}

